import React, { useState } from "react";
import video1 from "./assets/hiphop.mp4";

import Register from "./Components/register";
import Login from "./Components/login";
import Home from "./Components/Home";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from "react-router-dom";
import UserProfile from "./Components/user";

function App() {
  const [loggedIn, changeLogin] = useState(false);
  function change() {
    return changeLogin(true);
  }

  let routes;

  routes = (
    <React.Fragment>
      loggedIn ? <video src={video} autoPlay="true"></video>
      <Switch>
        <Home path="/" />
        <Route
          exact
          path="/register"
          render={(props) => <Register {...props} auth={change} />}
        ></Route>
        <Route exact path="/login" component={Login}></Route>
        <Route exact path="/user" component={UserProfile}></Route>
      </Switch>
    </React.Fragment>
  );

  return <Router>{routes}</Router>;
}

export default App;
